function pad(t){return 1===t.length?"0"+t:t}exports.rgbToHex=function(t,n,r){var e=t.toString(16),s=n.toString(16),o=r.toString(16);return pad(e)+pad(s)+pad(o)},exports.hexToRgb=function(t){return[parseInt(t.substring(0,2),16),parseInt(t.substring(2,4),16),parseInt(t.substring(4,6),16)]};